//import "../../globalStyles/variables";
import styles from "./Modal.module.scss";
const Modal = (props) => {
	return (
		<div>
			<header className={styles.modal}>{props.title}</header>
			<p>This is my modal</p>
		</div>
	);
};

export default Modal;
